import logo from "./logo.svg";
import "./App.css";
const num = 10;

const estilo = (bg='black') => ({
  backgroundColor: bg,
  color: "white",
  padding: "10px 15px",
});

const LI = ({ children }) => {
  return (
    <li style={estilo('green')} className="clase-li">
      {num}
    </li>
  );
};
function App() {
  return (
    <ul className="prueba">
      <LI estado="feliz"></LI>
    </ul>
  );
}

export default App;
